function initializeGoogleMaps(){geocoder=new google.maps.Geocoder;var e=new google.maps.LatLng(-34.397,150.644),t={zoom:16,center:e,panControl:!0,mapTypeId:google.maps.MapTypeId.ROADMAP,streetViewControl:!1};map=new google.maps.Map(document.getElementById("google-map-canvas"),t)}function codeAddress(e){geocoder.geocode({address:e},function(e,t){if(t==google.maps.GeocoderStatus.OK){map.setCenter(e[0].geometry.location);var n=new google.maps.Marker({map:map,position:e[0].geometry.location})}else alert("Geocode was not successful for the following reason: "+t)})}$(document).on("click","#mobileButton",function(){$("#mobileNavigation").stop(!0,!0).slideToggle()});$(document).ready(function(){var e=new Date;$("#dateText").text(e.getDate())});$(window).load(function(){$(".parallaxContainer").css("background-color","transparent")});var geocoder,map;